import React from 'react';
import '../App.css';
import './Section.css';

function Section() {
    return (
        <div className='section-container'>
            <div className="text-wrapper">
                <h1>Every brand should have <br/> a stunning web experience.</h1>
                <p>
                    I bring brands to life with stunning web experiences using cutting edge development techniques.
                    <br/>
                    I create mobile-first, responsive sites designed from users' perspectives.
                    <br/>
                    I custom build every site based on each client's specific needs.
                </p>
            </div>
        </div>
    );
}

export default Section;
